import React from 'react';

function ContactUs() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>
                    Contact Us
                </h1>
                <p>Interested in joining DayDream Magazine?</p>
            </header>

        </div>
    );
}

export default ContactUs;
